import React from "react";
import "./Form.css";
import zxcvbn from "zxcvbn";

export default class Progressbar extends React.Component {
  constructor(props) {
    super(props);
  }
  Test = zxcvbn(this.props.password);
  num = (Test.score * 100) / 4;
  ChangePassword = () => ({
    width: `${num}%`,
    background: "red",
    height: "7px",
  });

  render() {
    console.log(this.props.password);
    return (
      <>
        <div className="progress">
          <div className="progress-bar" style={this.ChangePassword()}></div>
        </div>
      </>
    );
  }
}
